def transform(sequence):
    new_sequence = list(sequence)
    for i in range(len(new_sequence)):
        if new_sequence[i] == '0':
            new_sequence[i] = '0'
        elif new_sequence[i] == '9':
            new_sequence[i] = '9'
        else:
            new_sequence[i] = '5'
    return "".join(new_sequence)
